Whiteout (2009)  

Verenigde Staten
Actie / Thriller
96 minuten

geregisseerd door Dominic Sena
met Kate Beckinsale, Gabriel Macht en Columbus Short

U.S. Marshal Carrie Stetko is als enige gelegerd in Antarctica. Ze moet daar een moord oplossen, op het continent waar het over drie dagen donker zal worden. Ze ontmoet een U.N. afgezant, die ook de moord onderzoekt.


